import React from 'react';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import Row from '@material-ui/core/Button';
import Col from '@material-ui/core/Button';
import Link from '@material-ui/core/Link';



export default function CTA() {
  return (
    <React.Fragment>
    <section className="section pt-0">
    <div className="productstitle">
    <h2 className="title">Where would you like to start?</h2>
    </div>

    <Container>
           <Row>

                       <Col lg="6" md="6" sm="12" className="newsblocks">
                           <div className="blog position-relative overflow-hidden shadow3d rounded newsbox">

                               <h4 className="mt-3 text-center title text-dark">Test</h4>
                               <p className="">Test </p>


                           </div>
                       </Col>

                       <Col lg="6" md="6" sm="12" className="newsblocks">
                           <div className="blog position-relative overflow-hidden shadow3d rounded newsbox">

                               <h4 className="mt-3 text-center title text-dark">Test</h4>
                               <p className="">Test </p>


                           </div>
                       </Col>


           </Row>
       </Container>



    </section>

    </React.Fragment>
  );
}
